import axios from "axios";
import { useDispatch, useSelector } from "react-redux";
const App=(userId)=>{
   let x;
   const user = useSelector(state => (state.userId));
   axios.get(`http://localhost:8080/api/bay/${user}`).then((data)=>
   x=data.data
   )
}
export default App;
